  const {id, name} = filterByPriceItem;
  console.log('name',name);
  return(
    <FilerByPriceItems>
      <Input type="checkbox" name="filterByPrice" value={id} nameLabel={name} id={id}/>
    </FilerByPriceItems>
  );
}
export default FilerByPriceItem;
